def ishappynumber(n):

	
	reminder = 0
	total = 0
    # taking the last digit
	while(n>0):
		reminder = n%10
		total = total +(reminder*reminder)
		n = n//10
	
	if(total==1):
		return True
    #when total >9 checking again whether it will total to 1 or not
	elif(total>9):
		return ishappynumber(total)	
	else:
		return False
